import React from 'react';

const NavBar = ({ onNavigate, user, onLogin, onLogout }) => {
  return (
    <nav className="bg-blue-600 text-white px-6 py-3 flex justify-between items-center">
      <div className="flex space-x-6 font-semibold">
        <button onClick={() => onNavigate('home')} className="hover:underline">Home</button>
        <button onClick={() => onNavigate('faq')} className="hover:underline">FAQ</button>
        <button onClick={() => onNavigate('results')} className="hover:underline">Results</button>
      </div>

      <div>
        {user ? (
          <div className="flex items-center space-x-4">
            <img src={user.picture} alt="profile" className="rounded-full w-8 h-8" />
            <span>{user.name}</span>
            <button onClick={onLogout} className="underline">Logout</button>
          </div>
        ) : (
          <button onClick={onLogin} className="underline">
            Sign In with Google
          </button>
        )}
      </div>
    </nav>
  );
};

export default NavBar;
